import { render } from '@testing-library/react';
import React from 'react';
import Typography from '@material-ui/core/Typography';
import Breadcrumbs from '@material-ui/core/Breadcrumbs';
import {Link} from 'react-router-dom'
import login from './login'

export default function Nav (props){
        const navStyle = {
            color:'white'
        }
        return(
            <Breadcrumbs aria-label="breadcrumb">
              <Link color="inherit" href="/" onClick={handleClick}>
                Material-UI
              </Link>
              <Link color="inherit" href="/getting-started/installation/" onClick={handleClick}>
                Core
              </Link>
              <Typography color="textPrimary">Breadcrumb</Typography>
            </Breadcrumbs>
          );
           { <nav className = "Nav">
            <h3>Logo</h3>

            { ((localStorage.getItem("jwt")===null))?
            <ul className ="Nav-List">
            {console.log('nav1')}
{console.log(localStorage.getItem("jwt"))}
            <Link style = {navStyle} to ="/about"> <li>About</li> </Link>
            <Link style = {navStyle} to ="/shop"><li>Shop</li> </Link>
            <Link style = {navStyle} to ="/register"><li>Register</li> </Link>
            <Link style = {navStyle} to ="/login"><li>Login</li> </Link>

            </ul>
           :(<ul className ="Nav-List">
           {console.log('nav2')}
           {console.log(localStorage.getItem("jwt"))}
       
           <Link style = {navStyle} to ="/about"> <li>About</li> </Link>
           <Link style = {navStyle} to ="/shop"><li>Shop</li> </Link>
           <Link style = {navStyle} to ="/cart"><li>Cart</li> </Link>
           <Link style = {navStyle} to ="/logout"><li>Logout</li> </Link>
           </ul>) }

     </nav>

           }
    }
